"2. Права и обязанности сторон",D=x(),z=w("p"),z.textContent="2.1. Исполнитель обязуется:",j=x(),K=w("p"),K.textContent="2.1.1. Самостоятельно и с использованием имеющегося собственного опыта,\n      знаний и привлеченных ресурсов с необходимой по обстоятельствам дела\n      заботливостью и осмотрительностью добросовестно осуществить подбор\n      автомобиля.",$=x(),G=w("p"),G.textContent="2.1.2. Осуществлять осмотр предварительно отобранных Автомобилей,\n      экспертную оценку состояния этих Автомобилей, а также диагностику\n      технического состояния, внутренней оснастки (состояние салона Автомобиля)\n      и внешнего лакокрасочного покрытия с помощью технических средств, с\n      предоставлением фотографий всех видимых дефектов автомобиля, Заказчику;",Y=x(),J=w("p"),J.textContent="2.1.3. Осуществить юридическую проверку Автомобиля и предоставить\n      соответствующие документы, что на момент покупки Автомобиль не находится в\n      базе розыска, угнанных, залоговых автомобилей и не имеет иных ограничений\n      и/или арестов.",Z=x(),tt=w("p"),tt.textContent="2.3. Заказчик обязуется:",et=x(),rt=w("p"),nt=v("2.3.1. До начала поиска Автомобиля оплатить на расчетный счет Исполнителя\n      задаток в размере "),it.c(),at=v(" рублей."),st=x(),lt=w("p"),lt.textContent="2.3.2. В случае отказа Заказчика от услуг Исполнителя по каким либо\n      причинам, задаток возврату не подлежит, так как, согласно международным\n      правилам, задаток считается невозвратным.",At=x(),ct=w("p"),ct.textContent="2.3.3. После нахождения Автомобиля Исполнителем, Исполнитель направляет\n      Заказчику электронное письмо с просьбой о подтверждение выбранного и\n      одобренного Заказчиком Автомобиля, с указанием марки, VIN номера, года\n      выпуска, пробега и окончательной цены Автомобиля с учетом внесённого\n      задатка. Заказчик обязан ответным письмом подтвердить покупку данного\n      Автомобиля с указанием марки, VIN номера, года выпуска.",ut=x(),dt=w("p"),dt.textContent="2.3.4 Исполнитель, после получения Заказчиком электронного письма с\n      подтверждением о покупке выбранного Автомобиля, внесёт полученные денежные\n      средства в виде задатка по настоящему договору продавцу Автомобиля в\n      качестве задатка для дальнейшего его выкупа. Остальные платежи требуемые\n      для выкупа и дальнейшей передачи Автомобиля Заказчику, будут оговорены с\n      Заказчиком отдельно путём оформления расписок.",ft=x(),pt=w("p"),pt.textContent="2.3.5. Автомобиль будет передан Исполнителем Заказчику после выплаты\n      полной стоимости Автомобиля указанного в письме подтверждении и оформлен\n      по договору купли - продажи на Заказчика.",mt=x(),ht=w("div"),gt=w("h6"),gt.textContent="3. Порядок расчетов по договору",bt=x(),wt=w("p"),vt=v("3.2.1. Стоимость услуг по настоящему Договору составляет "),yt.c(),Bt=v(" рублей."),_t=x(),kt=w("div"),kt.innerHTML='<h6 class="text-center fw-bold mt-3">4. Срок действия договора</h6> \n    <p class="text-justify">4.1. Срок исполнения настоящего Договора устанавливается с момента\n      получения Исполнителем денежных средств от Заказчика три месяца.</p> \n    <p class="text-justify">4.2. В случае не выполнения своих обязательств Исполнителем перед\n      Заказчиком, сумма задатка возвращается Исполнителем полностью.</p>',Et=x(),Ct=w("div"),Ct.innerHTML='<h6 class="text-center fw-bold mt-3">5. Обстоятельства непреодолимой силы.</h6> \n    <p class="text-justify html2pdf__page-break">5.1. При возникновении обстоятельств, которые каким-либо образом создают\n      невозможность выполнения обязательств по настоящему Договору одной из\n      сторон, а к таким обязательствам относятся: наводнения, землетрясения,\n      другие стихийные бедствия, а также пожары, военные действия, моратории,\n      перебои в работе транспорта, а также болезнь или временная\n      нетрудоспособность по любой уважительной причине одной из сторон договора,\n      срок выполнения обязательств по настоящему Договору будет увеличен на\n      период времени, в течение которого будут действовать эти обстоятельства и\n      их последствия.</p>',Qt=x(),Ut=w("div"),Ut.innerHTML='<h6 class="text-center fw-bold mt-3">6. Разрешение споров</h6> \n    <p class="text-justify">6.1. Все споры и разногласия, которые могут возникнуть в связи с\n      неисполнением или ненадлежащим исполнением условий настоящего Договора,\n      будут по возможности разрешены путем переговоров между сторонами в порядке\n      предъявления письменной претензии, которая подлежит рассмотрению стороной,\n      получившей ее, в срок не более 10 дней с момента ее получения. В случае\n      если стороны не придут к соглашению, дело подлежит к рассмотрению в суде в\n      соответствии с действующим законодательством.</p>',Ft=x(),St=w("div"),St.innerHTML='<h6 class="text-center fw-bold mt-3">7. Прочие условия</h6> \n    <p class="text-justify">7.1. Переписка через Интернет по средствам электронной почты, мессенджеров\n      WhatsApp, Viber и Telegram признаётся Сторонами официальной.</p> \n    <p class="text-justify">7.2. Договор составлен в двух экземплярах, имеющих равную юридическую силу\n      для каждой из Сторон.</p> \n    <p class="text-justify html2pdf__page-break">7.3. Любые изменения и дополнения к Договору имеют силу только в том\n      случае, если они оформлены в письменном виде и подписаны сторонами.</p>',Tt=x(),It=w("div"),Ht=w("h6"),Ht.textContent="8. Адреса и реквизиты Сторон",Ot=x(),Nt=w("div"),Pt=w("table"),Rt=w("thead"),Lt=w("tr"),Mt=w("th"),Dt=x(),zt=w("th"),jt=v("Заказчик"),Kt=w("br"),qt.c(),Vt=x(),Xt=w("th"),Xt.innerHTML='Исполнитель<br/><span class="fw-normal">_______________ _______________ _______________</span>',Wt=x(),Gt=w("tbody"),Yt=w("tr"),Jt=w("td"),Jt.textContent="ОГРНИП/ОГРН",Zt=x(),te=w("td"),re.c(),ne=x(),oe=w("td"),oe.textContent="_______________",ie=x(),ae=w("tr"),se=w("td"),se.textContent="ИНН",le=x(),Ae=w("td"),ue.c(),de=x(),fe=w("td"),fe.textContent="_______________",pe=x(),me=w("tr"),he=w("td"),he.te